"use strict";(self.webpackChunkopen_register_docs=self.webpackChunkopen_register_docs||[]).push([[581],{5610:e=>{e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"category","label":"Community","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Bijdragen aan OpenWoo.app","href":"/woo-website/docs/Community/Bijdragen","docId":"Community/Bijdragen"},{"type":"link","label":"Bijeenkomsten","href":"/woo-website/docs/Community/Bijeenkomsten","docId":"Community/Bijeenkomsten"},{"type":"link","label":"Leveranciers","href":"/woo-website/docs/Community/Leveranciers","docId":"Community/Leveranciers"},{"type":"link","label":"Overheden","href":"/woo-website/docs/Community/Overheden","docId":"Community/Overheden"},{"type":"link","label":"Tilburg","href":"/woo-website/docs/Community/Tilburg","docId":"Community/Tilburg"}]},{"type":"link","label":"Introductie","href":"/woo-website/docs/","docId":"intro"},{"type":"category","label":"product","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"FAQ","href":"/woo-website/docs/product/FAQ","docId":"product/FAQ"},{"type":"link","label":"Features","href":"/woo-website/docs/product/Features","docId":"product/Features"},{"type":"link","label":"Bestuur","href":"/woo-website/docs/product/GOVERNANCE","docId":"product/GOVERNANCE"},{"type":"link","label":"Kosten","href":"/woo-website/docs/product/Kosten","docId":"product/Kosten"},{"type":"link","label":"Roadmap Open WOO APP","href":"/woo-website/docs/product/Roadmap","docId":"product/Roadmap"},{"type":"link","label":"Beveiliging","href":"/woo-website/docs/product/VeiligheidEnToegankenlijkheid","docId":"product/VeiligheidEnToegankenlijkheid"}]},{"type":"category","label":"techniek","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Architectuur","href":"/woo-website/docs/techniek/Architectuur","docId":"techniek/Architectuur"},{"type":"link","label":"Configuratie","href":"/woo-website/docs/techniek/Configuratie","docId":"techniek/Configuratie"},{"type":"link","label":"Installatie","href":"/woo-website/docs/techniek/Installatie","docId":"techniek/Installatie"},{"type":"link","label":"Integratie","href":"/woo-website/docs/techniek/Integratie","docId":"techniek/Integratie"},{"type":"link","label":"Koophulp(je)","href":"/woo-website/docs/techniek/KoopHulp","docId":"techniek/KoopHulp"},{"type":"link","label":"In productie nemen","href":"/woo-website/docs/techniek/Productie","docId":"techniek/Productie"},{"type":"link","label":"Testscenario\'s","href":"/woo-website/docs/techniek/Tests","docId":"techniek/Tests"}]}]},"docs":{"Community/Bijdragen":{"id":"Community/Bijdragen","title":"Bijdragen aan OpenWoo.app","description":"Deelnemen aan het OpenWoo.app project is een uitnodiging om deel uit te maken van een gemeenschap die zich inzet voor het cre\xebren van een open en innovatief webplatform. Als open-source initiatief waarderen we de inbreng van iedereen, ongeacht ervaringsniveau of achtergrond. Hier zijn enkele manieren waarop u kunt bijdragen aan het project:","sidebar":"tutorialSidebar"},"Community/Bijeenkomsten":{"id":"Community/Bijeenkomsten","title":"Bijeenkomsten","description":"Meer weten over deze oplossing? Dat kan! Hiervoor hebben we een apart Slack kanaal binnen Common Ground. We helpen je daar graag verder. Uiteraard kan je ook altijd mailen naar info@conduction.nl.","sidebar":"tutorialSidebar"},"Community/Leveranciers":{"id":"Community/Leveranciers","title":"Leveranciers","description":"Deelnemende leveranciers","sidebar":"tutorialSidebar"},"Community/Overheden":{"id":"Community/Overheden","title":"Overheden","description":"","sidebar":"tutorialSidebar"},"Community/Tilburg":{"id":"Community/Tilburg","title":"Tilburg","description":"Context","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Introductie","description":"OpenWoo.app","sidebar":"tutorialSidebar"},"product/FAQ":{"id":"product/FAQ","title":"FAQ","description":"Dit zijn de algemene veelgestelde vragen over het gebruik en de configuratie van het OpenWoo platform. Mocht u een vraag hebben die hier niet beantwoord wordt, of wilt u een vraag toegevoegd zien aan deze lijst, dan nodigen we u uit om een issue aan te maken op onze GitHub-pagina.","sidebar":"tutorialSidebar"},"product/Features":{"id":"product/Features","title":"Features","description":"Een federaale search API","sidebar":"tutorialSidebar"},"product/GOVERNANCE":{"id":"product/GOVERNANCE","title":"Bestuur","description":"Het succes en de continue verbetering van het OpenWoo.app project zijn afhankelijk van een effectieve governance-structuur. Een belangrijk onderdeel van deze structuur is de stuurgroep, die verantwoordelijk is voor het beoordelen en prioriteren van de issues die op GitHub worden ingediend, en voor het bepalen welke daarvan worden opgenomen in de roadmap van het project.","sidebar":"tutorialSidebar"},"product/Kosten":{"id":"product/Kosten","title":"Kosten","description":"OpenWoo.app bestaat in essentie uit een drietal onderdelen die samen oplossing vormen, zie ook architectuur. Voor de totaaloplossing heeft u dan ook drie onderdelen nodig.","sidebar":"tutorialSidebar"},"product/Roadmap":{"id":"product/Roadmap","title":"Roadmap Open WOO APP","description":"Organisaties kunnen bijdragen aan deze roadmap door items aan te dragen, deze zelf op te pakken en uit te voeren, of door de uitvoering ervan te financieren.","sidebar":"tutorialSidebar"},"product/VeiligheidEnToegankenlijkheid":{"id":"product/VeiligheidEnToegankenlijkheid","title":"Beveiliging","description":"Wij geloven in het integreren van beveiliging in de kern van ons ontwikkelingsproces. We maken gebruik van geautomatiseerde penetratietesten en scanning als onderdeel van onze Continuous Integration en Continuous Deployment (CI/CD) pipeline. Deze aanpak stelt ons in staat om mogelijke beveiligingskwetsbaarheden vroegtijdig te identificeren en aan te pakken, tijdens de ontwikkelingsfase in plaats van later in de productiefase.","sidebar":"tutorialSidebar"},"techniek/Architectuur":{"id":"techniek/Architectuur","title":"Architectuur","description":"Architectuur Principes","sidebar":"tutorialSidebar"},"techniek/Configuratie":{"id":"techniek/Configuratie","title":"Configuratie","description":"Om te zorgen dat de OpenWoo-website goed werkt, is het belangrijk dat de onderliggende (zaak)systemen op de juiste manier zijn geconfigureerd. Zo kan het zaaksysteem de informatie aanleveren die op de voorkant nodig is voor het opbouwen van de index. Daarbij is het belangrijk om te weten welke waarden waar worden gebruikt en wat het effect is van configuratiekeuzes.","sidebar":"tutorialSidebar"},"techniek/Installatie":{"id":"techniek/Installatie","title":"Installatie","description":"Deze installatiehandleiding is bedoeld voor overheden en leveranciers die zelfstandig aan de slag willen met OpenWoo-website. Als je OpenWoo-website als SaaS wilt afnemen, kijk dan onder kosten.","sidebar":"tutorialSidebar"},"techniek/Integratie":{"id":"techniek/Integratie","title":"Integratie","description":"OpenWoo.app is essentie een koppelvlak waar aan de bovenkant meerdere weergaven of user interfaces op kunnen worden gekoppeld en aan de onderkant worden meerdere bronnen ontsloten.","sidebar":"tutorialSidebar"},"techniek/KoopHulp":{"id":"techniek/KoopHulp","title":"Koophulp(je)","description":"Vanuit de gemeente Buren is Koophulpje.nl opgezet. Het doel van Koophulpje is het doen van een proof of concept (poc) met de OpenWoo.app en het stellen van integrale zoek vragen aan de hand van het federale data stelsel (FSC) en API\'s.","sidebar":"tutorialSidebar"},"techniek/Productie":{"id":"techniek/Productie","title":"In productie nemen","description":"Het in productie nemen van OpenWoo.app voor uw organisatie is makkelijker dan u wellicht denkt. Hieronder vindt u de stappen die u moet volgen om succesvol over te gaan naar de productiefase.","sidebar":"tutorialSidebar"},"techniek/Tests":{"id":"techniek/Tests","title":"Testscenario\'s","description":"Om de Open WOO Website zelfstandig te kunnen installeren of doorontwikkelen, is het belangrijk om ook over herbruikbare testscenario\'s te beschikken. Daarnaast wilt u als afnemer ook graag weten of uw SAAS of SLA-product graag werkt. Daarvoor hebben we de volgende testscripts uitgeschreven.","sidebar":"tutorialSidebar"}}}')}}]);